import Vue from 'vue'
import App from './App.vue'
//引入vuex
import vuex from "vuex"
//使用插件
Vue.use(vuex)

//关闭Vue的生产提示
Vue.config.productionTip = false;

new Vue({
  render: h => h(App),
}).$mount('#app')
